import React, {useState} from 'react';

function Likes() {
    let [like1, setLike1] = useState(0);
    let [like2, setLike2] = useState(0);
    const color = 'purple'
    return (
        <div>
            <div>
                <h5>Did this place satisfy your munchies?</h5>
            </div>
            <button style={{ backgroundColor: color }} onClick={() => setLike1(++like1)}>
                {like1} Yum Yum!
            </button>
            <button style={{ backgroundColor: color }} onClick={() => setLike2(++like2)}>
                {like2} Hell Nah!
            </button>
        </div>
    );
}

export default Likes;
